  \"Population status, reproductive ecology and trophic relationships of seabirds
  in northwestern Alaska: Final report\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  1,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T23:02:55.210739\",\n\t\"name\": \"population-status-reproductive-ecology-and-trophic-relationships-of-seabirds-in-northweste\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Numbers of murres at two major breeding
  colonies in northern Alaska are declining and annual variability is high in a variety
  of elements of murre and kittiwake breeding biology. Two possibilities that could
  account for declining murre numbers are decreases in natality and/or increases in
  winter mortality. Annual variability in murre and kittiwake breeding biology is
  a function of prey availability, and is predictable from conditions in the physical
  environment during spring and summer. Seabirds are very sensitive indicators of
  environmental change. They are easily and economically studied by comparison to
  other high profile marine vertebrates. Studies of seabirds can yield a great amount
  of information on changes in marine food webs important to many top-level consumers.
  Such information will be necessary in order to identify possible effects of oil
  and gas development on regional marine ecosystems.\",\n\t\"license_title\": \"License
